import AppHeader from "../AppHeader";
import PostAddForm from "../PosrAddForm";
import PostList from "../PostList/PostList";
import PostStatusFilter from "../PostStastusFilter";
import SearchPanel from "../SearchPanel";
import './App.css'
const App = () => {
    const data =[
        {label:"Going to React JS",important:true},
        {label:"That is so good",important:false},
        {label:"I need a break... ",important:false}

    ]
    return (
        <div className="app">
            <AppHeader />
            <div className="search-panel d-flex">
                <SearchPanel />
                <PostStatusFilter />
            </div>
            <PostList posts={data}/>
            <PostAddForm />
        </div>
    )
}
export default App;
